import React, {Component} from 'react';
import './WaiterButton.css';
import BoxHeaderButton from './BoxHeaderButton';
import BoxHeader from './BoxHeader';

class WaiterButton extends Component {
  /*   WaiterButton (){
      ReactDom.render(<WaiterButton/>, document.getElementById('containerMenu'))
    }
    Kitchen (){
      ReactDom.render(<Kitchen/>, document.getElementById('conteinerMenu'))
    } */

    render (){
      return(
        <div className="BoxHeader">
        <nav>
        <a href = "/">
        </a>
        <button className ="BoxHeaderButton"> <BoxHeaderButton rol = "Meser@" customOnButtonClick ={this.WaiterButton}/></button>
        <button className ="BoxHeaderButton"> <BoxHeaderButton rol = "Cocina"/></button>
        </nav>
        <div id ="containerMenu"></div>
      </div>

      );
    }
  }

export default WaiterButton;
